import React, { useEffect, useState } from "react";

import axios from "axios";

const possibleWaypoints = [
  { name: "Espoo", rating: 5 },
  { name: "Helsinki", rating: 4 },
  { name: "Vantaa", rating: 3 },
];

const App = () => {
  const [waypoints, setWaypoints] = useState([]);

  useEffect(() => {
    axios.get("http://localhost:3001/api/get").then((res) => {
      setWaypoints(res.data);
    });
  }, []);

  const generate = () => {
    const randIndex = Math.floor(Math.random() * waypoints.length);
    const randomizedWaypoint = waypoints[randIndex];

    axios
      .post("http://localhost:3001/api/insert", randomizedWaypoint)
      .then(() => {
        alert("Successfully added a new waypoint");
      })
      .catch((err) => {});
  };
  return (
    <div>
      <h1>PathBuilder</h1>
      <button onClick={generate}>Generate waypoint!</button>
      {waypoints.map}
    </div>
  );
};

export default App;
